INSERT INTO `wp_posts` VALUES (226,1,'2023-09-13 03:27:08','2023-09-13 03:27:08','<!-- wp:acf/banner {\"name\":\"acf/banner\",\"data\":{\"background_mobile\":480,\"_background_mobile\":\"field_6512a673625ce\",\"background_desktop\":481,\"_background_desktop\":\"field_6512a688625cf\",\"background\":\"\",\"_background\":\"field_6512a668625cd\",\"icon_image\":482,\"_icon_image\":\"field_6512a7db625d2\",\"heading\":\"Affiliate Program\",\"_heading\":\"field_6512a696625d0\",\"sub_text\":\"Join the FundedX Affiliate Program and become part of our extended family. We offer a partnership that pays.\\r\\n\\r\\nYou can earn attractive commissions and enjoy unparalleled support by sharing our world-class trading platform with others. Together, let\'s create opportunities and drive success.\",\"_sub_text\":\"field_6512a6af625d1\"},\"mode\":\"edit\"} /-->\n\n<!-- wp:acf/text-with-media {\"name\":\"acf/text-with-media\",\"data\":{\"heading\":\"Join Our Affiliate Program\",\"_heading\":\"field_64b66b9cf71b5\",\"content\":\"\\u003cp\\u003e\\u003cbr data-mce-bogus=\\u00221\\u0022\\u003e\\u003c/p\\u003e\",\"_content\":\"field_64b66baaf71b6\",\"sub_text\":\"If you are interested to join our affiliate program, fill out the form below. Once we have reviewed your request, one of our team members will be in touch. Thank you for your interest!\",\"_sub_text\":\"field_65153fe4435ca\",\"shortcode\":\"[forminator_form id=\\u0022500\\u0022]\",\"_shortcode\":\"field_65153fc15228a\",\"cta\":\"\",\"_cta\":\"field_64b66bb1f71b7\",\"alignment\":\"left\",\"_alignment\":\"field_64b66bbbf71b8\",\"media\":550,\"_media\":\"field_64b66bd5f71b9\",\"icon_image\":\"\",\"_icon_image\":\"field_6515394739233\"},\"mode\":\"edit\"} /-->','Affiliate Program','','publish','closed','closed','','affiliate-program','','','2023-09-28 08:59:04','2023-09-28 08:59:04','',0,'http://fundedx:8888/?page_id=226',0,'page','',0);
