INSERT INTO `wp_posts` VALUES (230,1,'2023-09-13 05:10:21','2023-09-13 05:10:21','<!-- wp:heading --><h2>Who we are</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Our website address is: http://localhost:8899.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Comments</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Media</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Cookies</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Embedded content from other websites</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Who we share your data with</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you request a password reset, your IP address will be included in the reset email.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>How long we retain your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What rights you have over your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Where we send your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Visitor comments may be checked through an automated spam detection service.</p><!-- /wp:paragraph -->','Privacy Policy','','inherit','closed','closed','','3-revision-v1','','','2023-09-13 05:10:21','2023-09-13 05:10:21','',3,'http://fundedx:8888/?p=230',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (231,1,'2023-09-13 05:10:52','2023-09-13 05:10:52','<!-- wp:acf/article {\"name\":\"acf/article\",\"data\":{\"article_title\":\"Terms Of Use\",\"_article_title\":\"field_650d19de413d5\",\"repeated_text_field_0_list\":\"Information we collect: We may collect the following types of personal information:\\r\\n\\u003cul\\u003e\\r\\n \\t\\u003cli\\u003e Personal Identifiable Information (PII): Name, email address, postal address, phone number, date of birth, government-issued identification, and other information necessary for account verification.\\u003c/li\\u003e\\r\\n \\t\\u003cli\\u003e Financial Information: Bank account details, payment card details, and other financial data required for funding and withdrawals.\\u003c/li\\u003e\\r\\n \\t\\u003cli\\u003eTrading Information: Trading activity, transaction history, trading strategies, risk tolerance, and performance data.\\u003c/li\\u003e\\r\\n \\t\\u003cli\\u003eCommunication Information: Information you provide through our customer support channels, emails, or other communication methods.\\u003c/li\\u003e\\r\\n \\t\\u003cli\\u003eCommunication Information: Information you provide through our customer support channels, emails, or other communication methods.\\u003c/li\\u003e\\r\\n\\u003c/ul\\u003e\",\"_repeated_text_field_0_list\":\"field_650d981179162\",\"repeated_text_field\":1,\"_repeated_text_field\":\"field_650d19f3413d6\",\"additional_text_position\":\"Before\",\"_additional_text_position\":\"field_650da90ee9403\",\"additional_texts_0_text\":\"At FundedX, we are committed to protecting the privacy and confidentiality of the personal information of our clients, partners, and website users. This Privacy Policy outlines how we collect, use, disclose, and safeguard your personal information. By using our services, you consent to the practices described in this policy.\",\"_additional_texts_0_text\":\"field_650d9d06e197a\",\"additional_texts\":1,\"_additional_texts\":\"field_650d9cf4e1979\",\"background_mobile\":290,\"_background_mobile\":\"field_650d1ed1d4a71\",\"background_desktop\":290,\"_background_desktop\":\"field_650d1ef9d4a72\",\"background\":\"\",\"_background\":\"field_650d1eb5d4a70\"},\"mode\":\"edit\"} /-->','Refund Policy','','publish','closed','closed','','refund-policy','','','2023-09-28 07:04:28','2023-09-28 07:04:28','',0,'http://fundedx:8888/?page_id=231',0,'page','',0);
